@OliverB_1998 The first 'A' opponents faced by 
Aldershot FC in #FACup was Addlestone in 1927/28 - Aldershot won 8-0.

The first 'A' opponents faced by 
@OfficialShots in #FACup was Ashford Town in 1995/96 - Ashford won 2-0

@FoundLozzed The first 'B' opponents faced by 
@BCFC in #FACup was Birmingham Excelsior in 1883/84 as Small Heath Alliance - Excelsior won 2-0 after 1-1 draw.

The first 'B' opponents as Birmingham was Barnsley in 1911/12 - Barnsley won 3-0 after a 0-0 draw

@bertiethegills The first 'G' opponents faced by 
@TheGillsFC in #FACup was Gravesend Utd in 1896/97 - Gills were known as New Brompton then and won 4-1

The first 'G' opponents as Gillingham was original Guildford City in 1930/31 - Gills won 7-2

